B.a3r=new A.m(B.j,['\u0412 \u0434\u0430\u043d\u043d\u043e\u0439 \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0442\u0435\u0440\u043c\u0438\u043d\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043f\u0440\u0438\u0441\u0432\u043e\u0435\u043d\u043e \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435. \u0422\u0430\u043a\u0438\u0435 \u0442\u0435\u0440\u043c\u0438\u043d\u044b \u0438 \u0438\u0445 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u044b \u043d\u0438\u0436\u0435:\n\n\u041a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u044e\u0449\u0435\u0435 \u043b\u0438\u0446\u043e: \u043b\u0438\u0446\u043e, \u0438\u043c\u0435\u044e\u0449\u0435\u0435 \u043f\u0440\u0430\u0432\u043e \u043f\u0440\u044f\u043c\u043e \u0438\u043b\u0438 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u043e (\u0447\u0435\u0440\u0435\u0437 \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u044b\u0445 \u0435\u043c\u0443 \u043b\u0438\u0446) \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0430\u0442\u044c\u0441\u044f \u0432 \u0441\u0438\u043b\u0443 \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0438 (\u0438\u043b\u0438) \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u0432 \u0434\u043e\u0432\u0435\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u043c \u0438 (\u0438\u043b\u0438) \u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e \u0442\u043e\u0432\u0430\u0440\u0438\u0449\u0435\u0441\u0442\u0432\u0430, \u0438 (\u0438\u043b\u0438) \u043f\u043e\u0440\u0443\u0447\u0435\u043d\u0438\u044f, \u0438 (\u0438\u043b\u0438) \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u043d\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f, \u0438 (\u0438\u043b\u0438) \u0438\u043d\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f, \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0430\u0432, \u0443\u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u0435\u043d\u043d\u044b\u0445 \u0430\u043a\u0446\u0438\u044f\u043c\u0438 (\u0434\u043e\u043b\u044f\u043c\u0438) \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438, \u0431\u043e\u043b\u0435\u0435 50 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u0430\u043c\u0438 \u0433\u043e\u043b\u043e\u0441\u043e\u0432 \u0432 \u0432\u044b\u0441\u0448\u0435\u043c \u043e\u0440\u0433\u0430\u043d\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043b\u0438\u0431\u043e \u043f\u0440\u0430\u0432\u043e \u043d\u0430\u0437\u043d\u0430\u0447\u0430\u0442\u044c (\u0438\u0437\u0431\u0438\u0440\u0430\u0442\u044c) \u0435\u0434\u0438\u043d\u043e\u043b\u0438\u0447\u043d\u044b\u0439 \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043e\u0440\u0433\u0430\u043d \u0438 (\u0438\u043b\u0438) \u0431\u043e\u043b\u0435\u0435 50 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u043e\u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u043a\u043e\u043b\u043b\u0435\u0433\u0438\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0440\u0433\u0430\u043d\u0430 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438.\n\n\u041f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u043e\u0435 \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043b\u0438\u0446\u043e (\u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f): \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043b\u0438\u0446\u043e, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0435\u0435\u0441\u044f \u043f\u043e\u0434 \u043f\u0440\u044f\u043c\u044b\u043c \u0438\u043b\u0438 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u044b\u043c \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0435\u043c \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u044e\u0449\u0435\u0433\u043e \u043b\u0438\u0446\u0430.\n\n\u0421\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u043b\u0438\u0446\u0430: \u0441\u0443\u043f\u0440\u0443\u0433 (\u0441\u0443\u043f\u0440\u0443\u0433\u0430), \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u0438, \u0434\u0435\u0442\u0438, \u0443\u0441\u044b\u043d\u043e\u0432\u0438\u0442\u0435\u043b\u0438, \u0443\u0441\u044b\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435, \u043f\u043e\u043b\u043d\u043e\u0440\u043e\u0434\u043d\u044b\u0435 \u0438 \u043d\u0435\u043f\u043e\u043b\u043d\u043e\u0440\u043e\u0434\u043d\u044b\u0435 \u0431\u0440\u0430\u0442\u044c\u044f \u0438 \u0441\u0435\u0441\u0442\u0440\u044b, \u0431\u0430\u0431\u0443\u0448\u043a\u0438 \u0438 \u0434\u0435\u0434\u0443\u0448\u043a\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043b\u044e\u0431\u043e\u0435 \u0438\u043d\u043e\u0435 \u043b\u0438\u0446\u043e, \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u044e\u0449\u0435\u0435 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u0447\u043b\u0435\u043d\u043e\u043c \u0421\u043e\u0432\u0435\u0442\u0430 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u0432 \u0438 \u0432\u0435\u0434\u0443\u0449\u0435\u0435 \u0441 \u043d\u0438\u043c \u043e\u0431\u0449\u0435\u0435 \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u043e.\n\n\u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440: \u043b\u0438\u0446\u043e, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0438\u043c\u0435\u0435\u0442 \u043f\u0440\u0430\u0432\u043e \u043f\u0440\u044f\u043c\u043e \u0438\u043b\u0438 \u043a\u043e\u0441\u0432\u0435\u043d\u043d\u043e (\u0447\u0435\u0440\u0435\u0437 \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u044b\u0445 \u0435\u043c\u0443 \u043b\u0438\u0446), \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e \u0438\u043b\u0438 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u0438\u043d\u044b\u043c\u0438 \u043b\u0438\u0446\u0430\u043c\u0438, \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u043c\u0438 \u0441 \u043d\u0438\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u043c \u0434\u043e\u0432\u0435\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u043c, \u0438 (\u0438\u043b\u0438) \u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e \u0442\u043e\u0432\u0430\u0440\u0438\u0449\u0435\u0441\u0442\u0432\u0430, \u0438 (\u0438\u043b\u0438) \u043f\u043e\u0440\u0443\u0447\u0435\u043d\u0438\u044f, \u0438 (\u0438\u043b\u0438) \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u043d\u044b\u043c \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435\u043c, \u0438 (\u0438\u043b\u0438) \u0438\u043d\u044b\u043c \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435\u043c, \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0430\u0432, \u0443\u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u0435\u043d\u043d\u044b\u0445 \u0430\u043a\u0446\u0438\u044f\u043c\u0438 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430, \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0430\u0442\u044c\u0441\u044f 5 \u0438 \u0431\u043e\u043b\u0435\u0435 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u0430\u043c\u0438 \u0433\u043e\u043b\u043e\u0441\u043e\u0432, \u043f\u0440\u0438\u0445\u043e\u0434\u044f\u0449\u0438\u0445\u0441\u044f \u043d\u0430 \u0433\u043e\u043b\u043e\u0441\u0443\u044e\u0449\u0438\u0435 \u0430\u043a\u0446\u0438\u0438, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0435 \u0443\u0441\u0442\u0430\u0432\u043d\u044b\u0439 \u043a\u0430\u043f\u0438\u0442\u0430\u043b \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430.\n\n\u0413\u0440\u0443\u043f\u043f\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439, \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u0445\u043e\u0434\u0438\u0442 \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430: \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043b\u0438\u0446\u0430, \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u044b\u0435 \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c\u0443 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u0443 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430, \u0438/\u0438\u043b\u0438 \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043b\u0438\u0446\u0430 \u043f\u043e\u0434\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u044b\u0435 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u044e\u0449\u0435\u043c\u0443 \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u0430 \u043b\u0438\u0446\u0443 (\u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u0430 \u0438/\u0438\u043b\u0438 \u043b\u0438\u0446\u043e, \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u044e\u0449\u0435\u0435 \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u0430). \u041f\u043e\u043d\u044f\u0442\u0438\u0435 \xab\u0413\u0440\u0443\u043f\u043f\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439, \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0432\u0445\u043e\u0434\u0438\u0442 \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430\xbb \u043d\u0435 \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f \u043a \u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c\u0443 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u0443 - \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438, \u0441\u0443\u0431\u044a\u0435\u043a\u0442\u0443 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0438\u043b\u0438 \u043c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044e.\n\n\u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u043a\u043e\u043d\u043a\u0443\u0440\u0435\u043d\u0442\u044b: \u041f\u0410\u041e "\u0412\u044b\u043c\u043f\u0435\u043b\u041a\u043e\u043c", \u041f\u0410\u041e \xab\u041c\u0435\u0433\u0430\u0424\u043e\u043d\xbb, \u041e\u041e\u041e \xab\u04222 \u0420\u0422\u041a \u0425\u043e\u043b\u0434\u0438\u043d\u0433\xbb.\n\n\u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043a\u043e\u043d\u0442\u0440\u0430\u0433\u0435\u043d\u0442: \u043b\u0438\u0446\u043e, \u044f\u0432\u043b\u044f\u044e\u0449\u0435\u0435\u0441\u044f \u0441\u0442\u043e\u0440\u043e\u043d\u043e\u0439 \u043f\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 (\u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430\u043c) \u0441 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\u043c, \u0440\u0430\u0437\u043c\u0435\u0440 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432 \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443(\u044b\u043c) \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 2 \u0438\u043b\u0438 \u0431\u043e\u043b\u0435\u0435 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u0430 \u0431\u0430\u043b\u0430\u043d\u0441\u043e\u0432\u043e\u0439 \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u0438 \u043a\u043e\u043d\u0441\u043e\u043b\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0430\u043a\u0442\u0438\u0432\u043e\u0432 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\u043c \u0438\u043b\u0438 \u044d\u0442\u043e\u0433\u043e \u043b\u0438\u0446\u0430 \u043d\u0430 \u043e\u0442\u0447\u0435\u0442\u043d\u0443\u044e \u0434\u0430\u0442\u0443, \u043f\u0440\u0435\u0434\u0448\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0443\u044e \u043c\u043e\u043c\u0435\u043d\u0442\u0443 \u043e\u0446\u0435\u043d\u043a\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043a\u043e\u043d\u0442\u0440\u0430\u0433\u0435\u043d\u0442\u0430, \u043b\u0438\u0431\u043e 2 \u0438\u043b\u0438 \u0431\u043e\u043b\u0435\u0435 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0439 \u0432\u044b\u0440\u0443\u0447\u043a\u0438 (\u0434\u043e\u0445\u043e\u0434\u043e\u0432) \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\u043c \u0438\u043b\u0438 \u044d\u0442\u043e\u0433\u043e \u043b\u0438\u0446\u0430 \u0437\u0430 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044b\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u043d\u044b\u0439 \u0433\u043e\u0434, \u043f\u0440\u0435\u0434\u0448\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 \u043c\u043e\u043c\u0435\u043d\u0442\u0443 \u043e\u0446\u0435\u043d\u043a\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043a\u043e\u043d\u0442\u0440\u0430\u0433\u0435\u043d\u0442\u0430. \u041f\u0440\u0438 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u0443 \u043a\u043e\u043d\u0442\u0440\u0430\u0433\u0435\u043d\u0442\u0430 \u043a\u043e\u043d\u0441\u043e\u043b\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0439 \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u043e\u0439 \u043e\u0442\u0447\u0435\u0442\u043d\u043e\u0441\u0442\u0438, \u0434\u043b\u044f \u0441\u043e\u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043c\u043e\u0436\u0435\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0441\u043a\u0430\u044f \u043e\u0442\u0447\u0435\u0442\u043d\u043e\u0441\u0442\u044c \u043a\u043e\u043d\u0442\u0440\u0430\u0433\u0435\u043d\u0442\u0430.\n\n\u0423\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f: \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f, \u0443\u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0435\u043d\u043d\u0430\u044f \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0435\u0434\u0438\u043d\u043e\u043b\u0438\u0447\u043d\u043e\u0433\u043e \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0440\u0433\u0430\u043d\u0430 \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043f\u0440\u0438\u043c\u0435\u043d\u0438\u043c\u044b\u043c\u0438 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f\u043c\u0438 \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438.\n',"With this declaration, certain terms have been used that have particular meanings associated with them.  These terms, and their meanings, are as follows:\n\nControlling person: person who have the right, directly or indirectly (through other legal entities) to dispose by virtue of participation in a controlled organization and (or) on the basis of property trust contracts, and (or) in a simple partnership, and (or) by means of instructions, and (or) shareholder agreement, and (or) other agreement, which subject-matter is to exercise the rights certified by shares (stakes) of the controlled organization, by more than 50 percent of votes in the supreme executive body of the controlled organization; or the right to appoint (elect) the sole executive body and (or) more than 50 percent of the composition of a collegial executive body of the controlled organization.\n\nControlled person (controlled entity): legal entity, which is directly or indirectly controlled by a controlled person. \n\nRelated persons: spouse, parents, children, adoptive parents, adopted children, siblings (including half-sisters and half-brothers), grandparents, and any other individual residing together with such first individual and having a common household with him/her.  \n\nSubstantial shareholder: any person who is entitled, whether directly or indirectly (acting through entities controlled thereby), on his own or together with other persons associated therewith by virtue of a property trust management agreement, and/or a simple partnership agreement, and/or a commission agreement, and/or a shareholder agreement, and/or another agreement the subject matter of which is the exercise of rights evidenced by shares (interests) in the Company to cast 5 or more percent of votes attaching to the Company\u2019s voting shares in its share capital. \n\nGroup of organizations, which includes the Substantial Shareholder of the Company: legal entities controlled by the Substantial Shareholder of the Company, and / or legal entities controlled by the controller of the Substantial Shareholder (including a Substantial Shareholder and / or person controlling the Substantial Shareholder). The concept of a group of organizations, which includes the Substantial Shareholder of the Company, does not apply to the Substantial Shareholder - the Russian Federation, a constituent entity of the Russian Federation or a municipality.\n\nMajor counterparties: VympelCom PJSC, MegaFon PJSC, T2 RTK Holding LLC.\n\nMajor counterparty: any person that is the party to agreement(s) with the Company, whereby the amount of obligations is 2 or more percent of the book value of the Company's or such person's consolidated assets as of the reporting date preceding the assessment of the counterparty materiality, or 2 or more percent of the Company's or such person's consolidated revenues (income) for the complete calendar year preceding the assessment of the counterparty materiality. If the counterparty's consolidated financial statements are not available, the accounting statements of such counterparty may be used for comparison purposes.\n\nManaging entity: an entity that is entitled to act as the Company\u2019s sole executive body in accordance with the applicable provisions of the laws of the Russian Federation.\n"],t.e)
